import React from 'react';
import { ArrowDownOutlined, ArrowUpOutlined } from '@ant-design/icons';
import { Card, Col, Row, Statistic } from 'antd';

export const Charpclien = () => (
  <div>
 <Row className='flex px-1 px-2  w-full max-w-100' gutter={16}>
    <Col className='px-2'  span={20}>
      <Card   bordered={false}>
        <Statistic
          title="Clientes"
          value={11.28}
          precision={2}
          valueStyle={{
            color: '#3f8600',
          }}
          prefix={<ArrowUpOutlined />}
          suffix="%"
        />
      </Card>
    </Col>
    
    
  </Row>

<Row>
<Col span={20}>
      <Card bordered={false}>
        <Statistic
          title="Garantias"
          value={9.3}
          precision={2}
          valueStyle={{
            color: '#cf1322',
          }}
          prefix={<ArrowDownOutlined />}
          suffix="%"
        />
      </Card>
    </Col>
    </Row>
    </div>
)
